const SlideImages = ({ img, url }) => (
  <>
    <a href={url}>
      <img src={img} />
    </a>
    <style jsx>
      {`
        img {
          width: 530px;
          height: 340px;
          opacity: 0.8;
          transition: 0.5s all ease;
        }

        img:hover {
          transform: scale(1.1);
          opacity: 1;
        }
      `}
    </style>
  </>
);

export default SlideImages;
